import React from 'react';
import { Button, Navbar, Nav, NavDropdown, FormControl,Form } from 'react-bootstrap'
import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip } from 'recharts';
import { PureComponent } from 'react';
import {
  AreaChart, Area} from 'recharts';

  const data2 = [
  {
    name: '10 am', uv: 4000, pv: 2400, amt: 2400,
  },
  {
    name: '12 pm', uv: 3000, pv: 1398, amt: 2210,
  },
  {
    name: '2 pm', uv: 2000, pv: 9800, amt: 2290,
  },
  {
    name: '4 pm', uv: 2780, pv: 3908, amt: 2000,
  },
  {
    name: '6 pm', uv: 1890, pv: 4800, amt: 2181,
  },
  {
    name: '8 pm', uv: 2390, pv: 3800, amt: 2500,
  },
  {
    name: '10 pm', uv: 3490, pv: 4300, amt: 2100,
  },
];

const data = [{name: 'Enero', uv: 100, pv: 2600, amt: 2900},{name: 'Febrero', uv: 400, pv: 1200, amt: 1400},{name: 'Marzo', uv: 400, pv: 2400, amt: 2400}];
const LandingPage = () => (
  <div>
    <div class="jumbotron">
  <h1>Dashboard de Colombia Viva</h1>
  <p>Aquí encontrarás toda la información de negocio de la app</p>
</div>



<div class="container">
  <div class="row">
    <div class="col-sm-6">
      <h1>Bootstrap Grid Demo</h1>
        <LineChart width={600} height={300} data={data} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
           <Line type="monotone" dataKey="uv" stroke="#2d572c" />
           <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
           <XAxis dataKey="name" />
           <YAxis />
           <Tooltip />
         </LineChart>
    </div>
    <div class="col-sm-6 other">
      <h1>2 Columns</h1>
    </div>
  </div>
</div>


<div class="container">
  <div class="row">
    <div class="col-md my-4">
      <h6>Pregunta 1: Número de usuarios Android</h6>
      <LineChart width={600} height={300} data={data} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
         <Line type="monotone" dataKey="uv" stroke="#2d572c" />
         <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
         <XAxis dataKey="name" />
         <YAxis />
         <Tooltip />
       </LineChart>
    </div>
    <div class="col-md my-4">
      <h6>Pregunta 2: Número de usuarios Android</h6>
        <AreaChart
            width={500}
            height={400}
            data={data2}
            margin={{
              top: 10, right: 30, left: 0, bottom: 0,
            }}
          >
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Area type="monotone" dataKey="uv" stroke="#8884d8" fill="#8884d8" />
          </AreaChart>
    </div>
    <div class="col-md my-4">
      <h6>Pregunta 1: Número de usuarios Android</h6>
      <LineChart width={600} height={300} data={data} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
         <Line type="monotone" dataKey="uv" stroke="#2d572c" />
         <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
         <XAxis dataKey="name" />
         <YAxis />
         <Tooltip />
       </LineChart>
    </div>
  </div>
</div>


  </div>
);

export default LandingPage;
